import React, { Component } from "react";
// import { db } from "../firebase";
import withAuthorization from "./withAuthorization";
import axios from 'axios';

class Predict extends Component {
  constructor(props) {
    super(props);
    this.state = this.props.location.state;
    console.log(this.props.location.state);
    // axios.post("https://masters-backend-1.wl.r.appspot.com/", {
        axios.post('https://localhost:5000', {
        email: this.state.email.toString(),
        grade: this.state.grade,
        gre: this.state.gre,
        work_ex: this.state.we,
        toefl: this.state.toefl,
        uid: this.state.uid.toString(),
        lor1: this.state.lor1,
        lor2: this.state.lor2,
        lor3: this.state.lor3,
        lor4: this.state.lor4,
      })
      .then(
        (response) => {
          console.log(response.data.mit.score);
          this.setState({
            mit: response.data.mit.score,
            utd: response.data.utd.score,
            ncsu: response.data.ncsu.score,
            neu: response.data.neu.score,
            usc: response.data.usc.score,
          });
        },
        (error) => {
          console.log(error);
        }
      );
  }

  render() {
    return (
      <div>
        <h1>Under Construction</h1>
        <div>
          <h4>Thank you for your patience {this.state.first_name}</h4>
          <p>Possibility of Acceptance</p>
          <p>MIT {this.state.mit}</p>
          <p>USC {this.state.usc}</p>
          <p>NCSU {this.state.ncsu}</p>
          <p>UTD {this.state.utd}</p>
          <p>NEU {this.state.neu}</p>
        </div>
      </div>
    );
  }
}

const authCondition = (authUser) => !!authUser;

export default withAuthorization(authCondition)(Predict); //grants authorization to open endpoint if an user is signed in
// export default Predict;
